const {
    describe,
    test,
} = require(`@jest/globals`)
const {
    strStr,
} = require(`../lib/alorithms`)

describe(`Return the index of the first occurrence of needle`, ()=> {
    test(`return 2 for ll`, () => {
        const haystack = `hello`
        const needle = `ll`
        const output = 2
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return -1 if there is no occurrence of needle`, () => {
        const haystack = `aaaaaaa`
        const needle = `bba`
        const output = -1
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if needle is an empty string`, () => {
        const haystack = `michael`
        const needle = ``
        const output = 0
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if the first is the needle`, () => {
        const haystack = `a`
        const needle = `a`
        const output = 0
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if the first is the needle`, () => {
        const haystack = `aa`
        const needle = `aa`
        const output = 0
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if the first is the needle`, () => {
        const haystack = `aaa`
        const needle = `aaaa`
        const output = -1
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if the first is the needle`, () => {
        const haystack = `mississippi`
        const needle = `issi`
        const output = 1
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return 0 if the first is the needle`, () => {
        const haystack = `mississippi`
        const needle = `issip`
        const output = 4
        expect(strStr(haystack, needle)).toEqual(output)
    })
    test(`return handle long strings with low runtime`, () => {
        const haystack = `""`
        const needle = ``
        const output = -1
        expect(strStr(haystack, needle)).toEqual(output)
    })
})
